There's a fairly common situation I ran into: I had a method on a Neon class or a function on the module where I wanted to return another Neon class instance, filled with data generated in the Rust code. In pure Rust, there's typically several ways to construct a struct. But in JS, there's just the one constructor, and in Neon it's even worse: there's just the one constructor, that only can take JS types as inputs. The first thing I thought of was to modify the underlying Rust type directly. So down I went reading through Neon source code, trying to figure out how I could either replace the Rust value of a constructed Neon class… or implement an entirely new constuctor, by hand, that would build the class but with Rust data instead of JS data. Turns out, this first one was the right idea… but the wrong, over-complicated approach. This pattern has two sides: I have to make sure that my Neon class constructor is cheap, has no side-effect, and does not depend on anything else than what I pass in. I had at some point a constructor that would do disk I/O based on paths passed in an arguments. That's a no-go. I replaced it with a constructor that only built up the underlying Rust type without doing anything else, and a load() function that would do the I/O and spit out a modified class instance using this very pattern. I have to wrap the target type in a tuple struct . That tuple struct needs to have its field marked pub, and that's what I target the Neon class at. struct WrapFoo(pub Foo); declare_types! { pub class JsFoo for WrapFoo { init(call) { ... } }
} With those two things done, the remaining bit is simple, especially combined with the previous pattern: fn load(call: Call) -> JsResult<JsList> { let scope = call.scope; let args = call.arguments; let base = args.require(scope, 0)?.check::<JsString>()?.value(); let posts = all::load(PathBuf::from(base)).to_vec(); let farg = vec![JsArray::new(scope, 0)]; // Look at the `jslist::new`! That's the pattern shown just before, // here used to construct a Neon class within a Rust function. let mut list = JsFunction::new(scope, jslist::new)? .call(scope, JsNull::new(), farg)? .check::<JsList>()?; // Here's the important bit! // See how the tuple struct wrapping allows you to replace the // underlying Rust value? That's the entire trick! list.grab(|list| list.0 = List::new(posts)); Ok(list)
}

