There is an assymmetry in the module system that... makes sense to anyone who's used language-level module systems but might not be immediately obvious when approaching this in the context of dynamic libraries. There are four types of exports and imports: functions (bread and butter), globals (i.e. constants and statics, but see later), memories (generally only one), tables (for dispatch and the like, which I don't much deal with). While engines do support all types, as per spec, languages targetting Wasm often only support functions well. It's not uncommon to initially start with an integration that expects an exported global, only to then change it to a function that's read on init and documented to need a constant output, because some desired language doesn't support making wasm globals. Wasm has the potential concept of multiple linear memories, and of exportable and importable memories. Currently, the spec only supports one memory, which can either be defined in the module or imported (defined elsewhere, including some other module). In theory and/or experiments, most languages also only support a single memory, or only support additional memories as addressable blobs of data. C &co, with manual memory management, can in theory allocate anywhere, and so may be better off... Rust's AllocRef nightly feature shows promise to be able to specify the allocator for some data, and therefore be able to configure multiple allocators each targeted at a different memory. However, that will require multiple memory support at the (spec and then) language level in the first place. For now, designing integrations to handle more than one memories is not required but a good future-proofing step. Exports are straightforward: each export has a name and maps to some entry in the module's index spaces. Once you compile a module from bytecode you can look up all of its exports and get the indices for the names. This is important later. Imports have two -level names: a namespace and a name. The idea is for integrations to both be able to provide multiple libraries of imports without clashes, and to support plugging one module's exports directly to another module's imports, presumably namespaced under the first module's name, version, some random string, etc. In practice there are two namespaces worth knowing about: env is the de-facto default namespace, and js is the de-facto namespace for web APIs. In Rust, to specify the import namespace (defaults to env), you need to use the #[link(wasm_import_namespace = "foo")] attribute on the extern block like so: #[link(wasm_import_namespace = "log")]
extern { fn trace(ptr: i32, len: i32); fn debug(ptr: i32, len: i32); fn info(ptr: i32, len: i32); fn warn(ptr: i32, len: i32); fn error(ptr: i32, len: i32);
}

