3 | enum u2 { 0, 1, 2, 3 } | ^ expected identifier error: aborting due to previous error [Exit: 1] Right, it doesn't even let us out of the gate, because identifiers cannot be digits. Hmm, maybe we can add an innocent-looking suffix there to bypass that silly restriction? use u2::*;
