# fn main () {
assert_eq!(0_u2, 0_u2);
# } $ rustc nothing-suspicious-here.rs
error: expected identifier, found `0_u2` --> nothing-suspicious-here.rs:3:11 |
3 | enum u2 { 0_u2, 1_u2, 2_u2, 3_u2 } | ^^^^ expected identifier error: aborting due to previous error Denied. Looks like we can't do it. But what if we wanted to look as if we'd side-stepped the issue and made crated integers work? Well, first we need to figure out this identifier thing. Who even decides what identifiers can look like?! The Rust Reference does: An identifier is any nonempty Unicode string of the following form: Either The first character has property XID_start . The remaining characters have property XID_continue . Alright. So there's a restricted set of Unicode characters that can start an identifier, and numbers aren't in that set. But can we find something discreet enough that is XID_Start? Why yes. Yes we can: Enter the Halfwidth Hangul Filler . This character is XID_Start, and (provided you have Hangul fonts) renders as… either a blank space, or nothing at all. Does it work? #[derive(Debug)]
