println!("{:?}", format!("{:?}", Foo::ﾠBar));
println!("{:?}", format!("{:?}", Foo::ﾠBar).as_bytes());
# } $ rustc notacrime.rs [Exit: 0] $ ./notacrime
"ﾠBar"
